import React from 'react';
import { Box, IconButton } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import PersonIcon from '@mui/icons-material/Person'; // Icono de perfil

const Navbar = () => {
  const navigate = useNavigate();

  return (
    <Box 
      sx={{
        position: 'fixed', // Fijo en la parte inferior
        bottom: 0,
        left: 0,
        right: 0,
        bgcolor: 'white', // Color de fondo
        boxShadow: 2, // Sombra para destacar la barra
        display: 'flex',
        justifyContent: 'center',
        padding: '8px',
        zIndex: 2000, // Z-index alto para estar por encima
      }}
    >
      <IconButton 
        onClick={() => navigate('/profile')} 
        aria-label="Profile"
      >
        <PersonIcon fontSize="large" />
      </IconButton>
    </Box>
  );
};

export default Navbar;
